/** @jsxImportSource @emotion/react */
import { css } from '@emotion/react';

export const AboutUsContainer = css({
    display: 'flex',
    alignItems: 'center',

    img: {
        maxWidth: '50%',
    },

    '@media only screen and (max-width: 600px)': {
        display: 'block',
        width: '100%',
        padding: '16px',
    }
})
